import { Box, Typography } from "@mui/material";

const Footer = () => {
  return (
    <Box bgcolor="#252F3D" height="88px">
      <Box>
        <Typography fontSize="16px" color="#FFFFFF">
          Copyright (c) 2023
        </Typography>
        <Typography fontSize="16px" color="#FFFFFF">
          Copyright (c) 2023
        </Typography>
      </Box>
    </Box>
  );
};

export default Footer;
